// frontend/src/components/Header.jsx
import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="page__header">
      <h1>城市大脑智能体</h1>
      <p className="subtitle">一个用于演示基于大语言模型（LLM）的多智能体协作的平台</p>
    </header>
  );
};

export default Header;
